import React, { useState } from "react";

const Register = () => {
  return (
    <div>
      <h1>Register</h1>
      <form>
        <input type="email" name="email" placeholder="email" />
        <input type="email" name="email" placeholder="email" />
        <input type="email" name="email" placeholder="email" />
      </form>
    </div>
  );
};

export default Register;
